import React from 'react';
import { FormContainer, InputField, SubmitButton, FormTitle, FormText, FormLink } from './LoginSignupStyles';

const SignupPage = () => {
  return (
    <FormContainer>
      <FormTitle>Sign Up</FormTitle>
      <form>
        <InputField type="email" placeholder="Email" required />
        <InputField type="password" placeholder="Password" required />
        <InputField type="password" placeholder="Confirm Password" required />
        <SubmitButton type="submit">Sign Up</SubmitButton>
      </form>
      <FormText>
        Already have an account? <FormLink to="/login">Login</FormLink>
      </FormText>
    </FormContainer>
  );
};

export default SignupPage;
